import React from "react";

const FreqQuestion = () =>{
    return(
        <div className="col-12">
            <div className="Freq_Question">
            <h4>What is SchoolWay, and how does it differ from traditional school management systems?</h4>
            <p>SchoolWay is a School Management Software as a Service (SaaS) that offers a modern and cloud-based approach to managing educational institutions. Unlike traditional systems, SchoolWay is accessible online, requires no local installations, and offers a more flexible and scalable solution.</p>


            </div>
        </div>

    )
}

export default FreqQuestion;
